import React, { Component } from 'react';

import '../Styles/Logo.css';

import img from '../images/solid_s.png'

 class HucksLogo extends Component {




  render() {
    return (
      <div>
        <div className="imagetag">
          <img src={img}  class={'solid_logo'} alt="LOGO" />
          </div>
          <div className="dropping_water" style={{backgroundColor: 'green'}}>

          </div>

      </div>
    )
  }
}


export default HucksLogo;
